### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Asymptotic Notation and Complexity Analysis**
- **Big O Notation**: Describes the upper bound of an algorithm's complexity.
  - \( f(n) = O(g(n)) \) if there exist constants \( c \) and \( n_0 \) such that \( f(n) \leq c \cdot g(n) \) for all \( n \geq n_0 \).
- **Time Complexity**: Analysis of the time taken by an algorithm to run as a function of the input size.
  - Example: \( O(n \log n) \) for efficient sorting algorithms like Merge Sort and Quick Sort.

#### 2. **Data Structures**
- **Linked Lists**: A linear data structure where each element is a separate object.
  - Operations: Insertion, deletion, searching.
  - Time Complexities:
    - Insertion at the end: \( O(n) \)
    - Deletion at the end: \( O(n) \)
    - Searching: \( O(n) \)
- **Hash Tables**: A data structure that implements an associative array, a structure that can map keys to values.
  - Collision Resolution: Linear probing.
  - Hash Function: \( h(\text{key}) = \text{key} \mod \text{table size} \).
- **Stacks and Queues**: Linear data structures that follow specific orders for operations.
  - Stack: Last In, First Out (LIFO).
  - Queue: First In, First Out (FIFO).

#### 3. **Sorting Algorithms**
- **Insertion Sort**: A simple sorting algorithm that builds the final sorted array one item at a time.
  - Time Complexity: \( O(n^2) \) in the worst case.
- **Merge Sort**: A divide-and-conquer algorithm that divides the input array into two halves, sorts them, and merges them.
  - Time Complexity: \( O(n \log n) \).
- **Quick Sort**: Another divide-and-conquer algorithm that picks a pivot element and partitions the array around the pivot.
  - Time Complexity: \( O(n \log n) \) on average, \( O(n^2) \) in the worst case.
- **Stable Sort**: A sorting algorithm that maintains the relative order of items with equal keys.

#### 4. **Graph Algorithms**
- **Breadth-First Search (BFS)**: An algorithm for traversing or searching tree or graph data structures.
  - Visits nodes level by level.
  - Time Complexity: \( O(V + E) \), where \( V \) is the number of vertices and \( E \) is the number of edges.
- **Depth-First Search (DFS)**: An algorithm for traversing or searching tree or graph data structures.
  - Visits nodes by going as deep as possible along each branch before backtracking.
  - Time Complexity: \( O(V + E) \).
- **Topological Sorting**: A linear ordering of vertices such that for every directed edge \( uv \), vertex \( u \) comes before \( v \) in the ordering.
  - Used in directed acyclic graphs (DAGs).

#### 5. **Graph Theory**
- **Directed Acyclic Graph (DAG)**: A directed graph with no directed cycles.
- **BFS Tree**: A tree structure derived from the BFS traversal of a graph.
- **DFS Tree**: A tree structure derived from the DFS traversal of a graph.
- **Back Edges**: Edges that connect a vertex to an ancestor in the DFS tree, indicating a cycle.

#### 6. **Mathematical Concepts**
- **Unimodal List**: A list that consists of an increasing sequence followed by a decreasing sequence.
  - Example: \( L[0, \ldots, n-1] \) where \( L[i] < L[i + 1] \) for \( 0 \leq i < m \) and \( L[i] > L[i + 1] \) for \( m \leq i < n-1 \).
- **Graph Properties**: For a connected, simple, undirected graph \( G \) with \( E \) edges, the minimum number of vertices \( V \) can be found using the formula for the maximum number of edges in a simple graph:
  - \( E = \frac{V(V-1)}{2} \)
  - Solving for \( V \) given \( E = 1225 \).

